public class Solution {
    public int MinimizeConcatenatedLength(string[] words) {
        int n = words.Length;
        // dp[i][j] stores the minimum length of the string formed by concatenating
        // words from index i to j inclusively.
        int[,] dp = new int[n,n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                dp[i,j] = i == j ? words[i].Length : 100000; // Initialize with large value
            }
        }

        // Calculate savings when two words are joined.
        int[,] save = new int[n,n];
        for (int i = 0; i < n - 1; i++) {
            for (int j = i + 1; j < n; j++) {
                int minLen = Math.Min(words[i].Length, words[j].Length);
                for (int k = 1; k <= minLen; k++) {
                    if (words[i].EndsWith(words[j].Substring(0, k))) {
                        save[i,j] = Math.Max(save[i,j], k);
                    }
                }
            }
        }

        // Dynamic programming to find minimum length.
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                for (int k = i; k < j; k++) {
                    int cost = dp[i,k] + dp[k+1,j] - save[i,k] - save[k+1,j];
                    dp[i,j] = Math.Min(dp[i,j], cost);
                }
            }
        }

        return dp[0,n-1];
    }
}
